import React, {Component} from 'react';

//컴포넌트(사용자정의 테그)를 만드는 코드영역
class TOC extends Component{
    //class 안에서는 function을 생략할 수 있다.
    render(){
      return(
        <nav>
          <ul>
            <li><a href="1.html"></a> HTML</li>
            <li><a href="2.html"></a> CSS</li>
            <li><a href="3.html"></a> JS</li>
          </ul>
        </nav>
      );
    }
  }
